import React from 'react';

function ToDoItem({item, onDel}) {

    return ( 
        <div>
            <li>{item.text}</li>
            <button onClick={() => onDel(item.id)}>
                <span>Delete</span>
            </button>
        </div>
    )
}


export default ToDoItem;
